import React from 'react';
import './Epb.css';

function Epb() {
  return (
    <div className="epb-container">
      <img src="" alt="EPB Certification" className="epb-image fade-in" />
      <div className="epb-details fade-in">
        <h2 className="epb-title">EPB Certification</h2>
        <p className="epb-description">
          Our EPB certification showcases our commitment to providing environmentally responsible packaging solutions, ensuring compliance with environmental regulations and standards.
        </p>
      </div>
    </div>
  );
}

export default Epb;
